import React from "react";
import { Link } from "react-router-dom";
import MainLayout from "../layouts/MainLayout";

export default function Home() {
  return (
    <MainLayout>
      <div className="max-w-xl mx-auto p-10 bg-white rounded shadow text-center mt-10">
        <h1 className="text-3xl font-bold mb-4">CVD Risk Prediction & AI Chatbot</h1>
        <p className="mb-6">Empowering patients & doctors with smart predictions and knowledge.</p>
        <Link to="/login" className="mr-4 bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700">Sign In</Link>
        <Link to="/register" className="bg-green-600 text-white px-4 py-2 rounded hover:bg-green-700">Get Started</Link>
      </div>
    </MainLayout>
  );
}
